import React from 'react';
import './App.css';
import NavigationBar from './components/NavigationBar';
import Carousel from './components/Carousel';
import Footer from './components/Footer';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    return (
        <div className="App">
            <NavigationBar />
            <Carousel />
            <Footer />
        </div>
    );
}

export default App;
